import React from 'react';

const About = () => {
  return (
    <section className="about" id="about">
      <h2>About Me</h2>
      <div className="about-content">
        <div className="about-text">
          <p>
          Epic coders are highly skilled developers known for their problem-solving abilities, mastery of multiple programming languages, 
          and commitment to writing clean, efficient code. They thrive in collaborative environments, continuously learn new technologies, and 
          prioritize user experience, making them invaluable assets in creating innovative and effective software solutions.
          </p>
        </div>
        <div className="about-image">
          <img src="C:\Portfolio website\public\assets\images\Profile.jpg" alt="Profile.jpg" />
        </div>
      </div>
    </section>
  );
};

export default About;
